import Login from './src/view/Login';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import HomeNavigation from './src/view/HomeNavigation';
import EmployeeCard from './src/view/EmployeeCard';
import QuoteMenu from './src/view/QuoteMenu';
import QuoteCreation from './src/view/QuoteCreation';
import EstimationList from './src/view/EstimationList';
import React from 'react';
import { ApplicationProvider } from '@ui-kitten/components';
import * as eva from '@eva-design/eva';

const Stack = createStackNavigator();
export default function App() {

  return (
// ApplicationProvider sert a utiliser les components de UI Kitten
    <ApplicationProvider {...eva} theme={eva.light}>
      <NavigationContainer>
        <Stack.Navigator initialRouteName='HomeNavigation'>
          <Stack.Screen options={{ title: 'Accueil' }} name='HomeNavigation' component={HomeNavigation} />
          <Stack.Screen options={{ title: 'Employer' }} name='EmployeeCard' component={EmployeeCard} />
          <Stack.Screen options={{ title: 'Login' }} name='Login' component={Login} />
          <Stack.Screen options={{ title: 'Devis' }} name='QuoteMenu' component={QuoteMenu} />
          <Stack.Screen options={{ title: 'Création de devis' }} name='QuoteCreation' component={QuoteCreation} />
          <Stack.Screen options={{ title: 'Liste de devis' }} name='EstimationList' component={EstimationList} />
        </Stack.Navigator>
      </NavigationContainer>
    </ApplicationProvider>
  )
}
